import React from 'react';
import styles from './Analyze.module.scss'

export const Analyze = () => {
    const [url, changeUrl] = useState('zillow-url')

    return (
        <div className={styles.analyzeGround}>
            <h1>
                <span>
                   Analyze!
                </span>
            </h1>
                <input type="text" value='zillow-url' />
                <input type="text" value='purchase price' />
                <input type="text" value='renovation budget' /><button>Submit</button>
        </div>
    )
}

export default Analyze;
